INSERT INTO `sys_menu` VALUES ('3866', '云监控', '0', '9', 'cloudMonitor', null, '1', '0', 'C', '1', '1', null, '云监控', 'admin', '2022-04-27 17:13:24', 'admin', '2022-04-28 19:05:44', '云监控（CloudMonitor） 是一项针对天河数云资源和互联网应用进行监控的服务。云监控服务可用于收集获取天河数云资源的监控指标，探测互联网服务可用性，以及针对指标设置警报。', '', 'monitor', null);
INSERT INTO `sys_menu` VALUES ('3867', '中间件资源监控', '0', '10', '/middleMonitor', null, '1', '0', 'C', '1', '1', null, '中间件资源监控', 'admin', '2022-04-27 17:14:56', 'admin', '2022-04-28 16:03:46', '针对不同的中间件，可提供适配性中间件自动接入。可提供中间件相关的阈值监控，满足用户对中间件的监控需求。', '', 'monitor', null);
INSERT INTO `sys_menu` VALUES ('3881', '基础资源监控', '0', '15', 'http://monitor-qa.galaksiodatanubo.com/bigScreen', 'monitorScreen', '0', '0', 'C', '1', '0', null, '基础资源监控', 'admin', '2022-04-28 13:56:47', 'admin', '2022-05-10 10:05:26', '基础资源监控能针对服务器上线时间、总内存、CPU总核心数、硬盘使用量、CPU负载、内存负载等进行整体监控，并且以直观的图形化界面进行展示。', '', 'monitor', null);
INSERT INTO `sys_menu` VALUES ('3883', '多云资源管理', '0', '1', 'res', null, '1', '0', 'M', '0', '0', null, 'build', 'admin', '2022-04-29 14:58:48', '', null, '', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('3884', '资源生命周期管理', '3883', '1', '资源生命周期管理', '资源生命周期管理', '1', '0', 'C', '0', '1', null, '资源生命周期管理', 'admin', '2022-04-29 14:59:39', 'admin', '2022-05-06 09:14:23', '资源生命周期管理能够统一管理已接入到平台中的各个云环境的资源（计算、存储、网络、安全等），对这些资源支持整体生命周期管理： 云资源的创建、云资源的修改、云资源的停止、云资源的重启、云资源的销毁。', '资源生命周期管理', 'cmp', '资源生命周期管理');
INSERT INTO `sys_menu` VALUES ('4149', '数据源新增', '3502', '5', '', null, '1', '0', 'F', '0', '0', null, '#', 'admin', '2022-05-06 09:23:33', '', null, '', 'monitor:datasource:add', 'monitor', null);
