INSERT INTO `sys_menu` VALUES ('4151', '组织管理', '3883', '2', '/', null, '1', '0', 'C', '0', '1', null, '组织管理', 'admin', '2022-05-06 09:32:42', '', null, '多云管理平台提供管理员以树型结构方式配置多级组织信息 （分支机构） 以及部门关系，并为各级组织配置组织管理员，运维管理员等角色 用户信息。', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4152', '操作审计管理', '3883', '3', '/', null, '1', '0', 'C', '0', '1', null, '操作审计管理', 'admin', '2022-05-06 09:33:41', '', null, '提供组织下所有的实例/服务器执行任务的记录，包括所有创建、接管、脚本执行任务等。日志记录了任务名称，任务关联的实例/服务器对象，任务执行状态，失败任务的失败原因以及任务的开始时间与结束时间。', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4153', '运营分析', '3883', '4', '/', null, '1', '0', 'C', '0', '1', null, '运营分析', 'admin', '2022-05-06 09:34:51', '', null, '支持计算资源分析，从概览、资源列表、云环境、标签、组织多个维度进行分析。提供可视化的数据支撑用户决策。', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4154', '接入管理', '3883', '5', '/', null, '1', '0', 'C', '0', '1', null, '接入管理', 'admin', '2022-05-06 09:36:10', '', null, '平台支持各级企业云资源环境账号信息配置接入，各云平台资源信息同步等功能。并支持管理员对 各云平台的资源进行云化配置，将主机、存储、网络资源进行区域划分，组成资源池、并支持将分区资源池分配到项目中。前期多云管理平台主要考虑支持金山云和麒麟云的接入，后续逐步接入华为云等主流公有云及 VMware主流版本。', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4155', '统一资源视图', '3883', '6', '/', null, '1', '0', 'C', '0', '1', null, '统一资源视图', 'admin', '2022-05-06 09:36:46', 'admin', '2022-05-06 09:36:58', '云环境概览页面展示了接入的各云环境的基本信息概览。包括告警信息、监控数据统计、计算资源，存储资源以及网络资源统计。', '', 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4156', '资源实例管理', '3883', '7', '/', null, '1', '0', 'C', '0', '1', null, '资源实例管理', 'admin', '2022-05-06 09:37:35', 'admin', '2022-05-06 09:37:40', '资源实例模块对已创建了的资源进行实例化管理，对资源实例进行分类，并提供资源实例的查询，导出等功能，也可以作为资源操作的入口。', '', 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4157', '系统管理', '3883', '8', '/', null, '1', '0', 'M', '0', '1', null, '系统集成', 'admin', '2022-05-06 09:38:51', '', null, '系统管理提供角色管理、用户管理、组织管理，针对不通的角色可使用不同的权限进行控制。', null, 'cmp', null);
INSERT INTO `sys_menu` VALUES ('4158', '应用服务日志', '0', '1', '/', null, '1', '0', 'C', '0', '1', null, '应用服务日志', 'admin', '2022-05-06 09:54:47', '', null, '对采集的应用服务日志按照不同维度进行检索，可根据应用服务日志索引管理配置的查询字段、列表展示字段进行显示。', null, 'log', null);
INSERT INTO `sys_menu` VALUES ('4159', '操作系统日志', '0', '2', '/', null, '1', '0', 'C', '0', '1', null, '操作系统日志', 'admin', '2022-05-06 09:55:38', '', null, '对采集的操作系统日志按照不同维度进行检索，可根据操作系统日志索引管理配置的查询字段、列表展示字段进行显示。', null, 'log', null);
INSERT INTO `sys_menu` VALUES ('4160', '网络设备日志', '0', '3', '/', null, '1', '0', 'C', '0', '1', null, '网络设备日志', 'admin', '2022-05-06 09:56:10', '', null, '对采集的网络设备日志按照不同维度进行检索，可根据网络设备日志索引管理配置的查询字段、列表展示字段进行显示。', null, 'log', null);
INSERT INTO `sys_menu` VALUES ('4161', '用户审计', '0', '4', '/', null, '1', '0', 'C', '0', '1', null, '用户审计', 'admin', '2022-05-06 09:56:38', 'admin', '2022-05-06 09:56:45', '对用户行为进行日志审计，可溯源用户操作行为。', '', 'log', null);
INSERT INTO `sys_menu` VALUES ('4162', '个人中心', '0', '1', '/', null, '1', '0', 'C', '0', '1', null, '个人中心', 'admin', '2022-05-06 09:57:44', '', null, '个人中心显示个人通知、消息、以及待办，\n通知显示系统推送给当前用户的信息（系统通知）\n消息显示其他用户推送给当前用户的信息（订阅更新、浏览、评论、回复、点赞、@消息）\n待办显示需要当前用户处理的事项（审批、协同、审核）', null, 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4163', '知识库-系统管理', '0', '2', '/', null, '1', '0', 'C', '0', '1', null, '数据配置', 'admin', '2022-05-06 10:00:06', '', null, '系统管理包含对用户、角色、数据字典、菜单管理以及积分规则等进行统一管理。', null, 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4164', '知识库空间', '0', '3', '/', null, '1', '0', 'C', '0', '1', null, '知识库空间', 'admin', '2022-05-06 10:00:47', '', null, '展示当前用户有权限查看或者编辑的知识库，为知识库的编辑入库包含工作台、文档导入、文档分享、文档引用/复制/移动、知识库回收等相关操作', null, 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4165', '文档查阅', '0', '4', '/', null, '1', '0', 'C', '0', '1', null, '文档查阅', 'admin', '2022-05-06 10:01:25', '', null, '文档检索提供按照关键字进行全文检索搜素文档的能力， 提供高级检索能力。\n整个知识库内，所有允许搜索的文档，都可以使用全文检索搜索到（包含没有查看权限的文档），搜索结果中如果有无权限查看的文档，可以向该文档的作者或者该文档归属的知识库空间管理员申请查看权限。', null, 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4166', '标签管理', '0', '5', '/', null, '1', '0', 'C', '0', '1', null, '标签管理', 'admin', '2022-05-06 10:05:40', 'admin', '2022-05-06 10:05:48', '标签管理提供对标签的规整管理能力，以及对标签下的文档标签进行调整的能力。', '', 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4167', '个人空间', '0', '6', '/', null, '1', '0', 'C', '0', '1', null, '个人空间', 'admin', '2022-05-06 10:06:23', '', null, '个人空间相当于个人知识库，功能与知识库空间类似，区别是个人空间的拥有者为个人， 个人拥有对个人空间的全部权限， 而知识库空间的管理权限归属于组织。个人空间内的文档默认不公开，但是可以搜索引擎搜索到。', null, 'wiki', null);
INSERT INTO `sys_menu` VALUES ('4168', '文档编辑', '0', '7', '/', null, '1', '0', 'C', '0', '1', null, '文档编辑', 'admin', '2022-05-06 10:06:53', '', null, '文档编辑支持编辑富文本文档和markdown文档。', null, 'wiki', null);
