DROP TABLE IF EXISTS `uuc_model_info`;
CREATE TABLE `uuc_model_info` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键',
  `client_id` varchar(255) DEFAULT NULL COMMENT '模块code',
  `client_name` varchar(255) DEFAULT NULL COMMENT '模块名称',
  `client_rsa_private` varchar(1000) DEFAULT NULL COMMENT '模块rsa秘钥私钥',
  `client_rsa_public` varchar(255) DEFAULT NULL COMMENT '模块rsa秘钥公钥',
  `base_url` varchar(255) DEFAULT NULL COMMENT '模块基础url',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_client_id` (`client_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10000 DEFAULT CHARSET=utf8mb3;

